	add("declamation", "{\"term\":\"declamation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027déclamation\u0027 from Latin \u0027declamatio\u0027 from \u0027declamo\u0027 see \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or art of declaiming; rhetorical delivery; haranguing; loud speaking in public; especially, the public recitation of speeches as an exercise in schools and colleges; as, the practice declamation by students\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A set or harangue; declamatory discourse\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Pretentious rhetorical display, with more sound than sense; as, mere declamation\", \"priority\":3}]}, \"synonyms\":{}}");

	add("declan", "{\"term\":\"declan\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"anglicized form of an Irish Gaelic saint\u0027s name Deaglán\", \"priority\":1}]}, \"synonyms\":{}}");

	add("declaration", "{\"term\":\"declaration\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Old french (842-ca. 1400) \u0027declaration\u0027 (French \u0027déclaration\u0027 , from Latin \u0027declarationem\u0027 corresponding to {{suffix|declare|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A written or oral indication of a fact, opinion, or belief\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A list of items for various legal purposes, e.g. \u0027customs declaration\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act or process of declaring\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The act, by the captain of a batting side, of declaring an innings closed\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In common law, the formal document specifying plaintiff’s cause of action, including the facts necessary to sustain a proper cause of action, and to advise the defendant of the grounds upon which he is being sued\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The specification of a variable\u0027s type\", \"priority\":6}]}, \"synonyms\":{}}");

	add("declarator", "{\"term\":\"declarator\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A legal declaration\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A construct in a programming language that makes a declaration\", \"priority\":2}]}, \"synonyms\":{}}");

	add("declarer", "{\"term\":\"declarer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The person who wins the bidding and so declares what suit will be trump\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who declares\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A statement that declares the properties of a variable or contributes to doing so\", \"priority\":3}]}, \"synonyms\":{}}");

	add("declawing", "{\"term\":\"declawing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The surgical removal of claws; onychectomy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("declension", "{\"term\":\"declension\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027declenson\u0027, from Middle french (ca. 1400-1600) \u0027declinaison\u0027 (Modern French: \u0027déclinaison\u0027), from Latin \u0027declinatio\u0027 (genitive|gen. \u0027declinationis\u0027)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of declining a word; the act of listing the inflections of a noun, pronoun or adjective in order\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A way of categorizing nouns, pronouns, or adjectives according to the inflections they receive\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In Latin, \u0027amicus\u0027 belongs to the second \u0027\u0027declension\u0027\u0027. Most second-declension nouns end in \u0027-i\u0027 in the genitive singular and \u0027-um\u0027 in the accusative singular\", \"priority\":3}]}, \"synonyms\":{}}");

	add("declensionism", "{\"term\":\"declensionism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|declension|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A belief in a declining trend in a history\", \"priority\":1}]}, \"synonyms\":{}}");

	add("declensionist", "{\"term\":\"declensionist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|declension|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One offering a narrative of decline\", \"priority\":1}]}, \"synonyms\":{}}");

	add("declinature", "{\"term\":\"declinature\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of declining or refusing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The legal privilege of a party, in certain circumstances, to decline the jurisdiction of a judge before whom the party\u0027s case sits\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Recusal\", \"priority\":3}]}, \"synonyms\":{}}");

	add("decline", "{\"term\":\"decline\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027lang\u003denm\u0027 from Old french (842-ca. 1400) \u0027lang\u003dfro\u0027 from Latin \u0027lang\u003dla|declinare\u0027 () from \u0027lang\u003dla|de\u0027 () + {{m|la|clīnō||I bend, I incline}}, from Proto-indo-european {{m|ine-pro|*ḱley-}} (English \u0027lean\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Downward movement, fall\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A sloping downward, e.g. of a hill or road\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A weakening\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A reduction or diminution of activity\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"It is also pertinent to note that the current obvious \u0027\u0027decline\u0027\u0027 in work on holarctic hepatics most surely reflects a current obsession with cataloging and with nomenclature of the organisms—as divorced from their study as living entities\", \"priority\":5}]}, \"synonyms\":{}}");

	add("decliner", "{\"term\":\"decliner\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"one who declines\", \"priority\":1}]}, \"synonyms\":{}}");

	add("declinism", "{\"term\":\"declinism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|decline|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pessimistic belief that things are in decline\", \"priority\":1}]}, \"synonyms\":{}}");

	add("declinometer", "{\"term\":\"declinometer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027decline\u0027 (through Middle English and Old French from the Latin \u0027de-\u0027 \u0026quot;down\u0026quot; + \u0027clinare\u0027 \u0026quot;to bend\u0026quot;) + -meter\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An instrument for measuring magnetic declination\", \"priority\":1}]}, \"synonyms\":{}}");

	add("declivity", "{\"term\":\"declivity\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"1610s, from French \u0027déclivité\u0027 from Latin \u0027declivitatem\u0027 {{m|la|dēclīvitās}},from {{m|la|dēclivis||a sloping downward}}, from \u0027de\u0027 (down) + {{m|la|clīvus||a slope}}, from Proto-indo-european {{m|ine-pro|*ḱleywo-}}, from Proto-indo-european {{m|ine-pro|*ḱley-||to lean}} (English \u0027lean\u0027 .\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary|declivity}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the downward slope of a hil\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1899\u0027\u0027, Joseph Conrad, \u0027s:Heart of Heart of Darkness\u0027, s:Heart of Darkness/Section section\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A rocky cliff appeared, mounds of turned–up earth by the shore, houses on a hill, others with iron roofs, amongst a waste of excavations, or hanging to the \u0027\u0027declivity\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"a downward bend in a path\", \"priority\":4}]}, \"synonyms\":{}}");

	add("decluttering", "{\"term\":\"decluttering\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|de|clutter|ing|lang\u003den}}. Compare \u0027declutter\u0027 (attested later).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fact or process of removing clutter; tidying, removing unwanted or messy items from a given place\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Oliver Burkeman, \u0027The Guardian\u0027, 2 October\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027decluttering\u0027\u0027 trend is nothing new, and has much to recommend it, but every week now seems to bring a fresh example of what ascetics might once have called the renunciation of possessions […\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Lauren Rosenfeld and Melva Green, \u0027Breathing Room\u0027, p. 14\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Decluttering\u0027\u0027 is an act of compassion—for yourself and for others, because it frees you from draining influences so you can give yourself over fully to what you love and care for\", \"priority\":5}]}, \"synonyms\":{}}");

	add("decor", "{\"term\":\"decor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027décor\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The style of decoration of a room or building\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Her living room had a lush Persian-style \u0027\u0027decor\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A stage setting; scenery; set; backdrop\", \"priority\":3}]}, \"synonyms\":{}}");

	add("décor", "{\"term\":\"décor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|décor|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Category:English terms spelled with É\", \"priority\":1}]}, \"synonyms\":{}}");

	add("decoy", "{\"term\":\"decoy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Dutch\"], \"text\":\"From Dutch {{compound|de|kooi|lang\u003dnl|nocat\u003d1}}, literally \u0026quot;The Cage\u0026quot;. Possibly related to verb {{m|en|coy}} (which itself may have been influenced by decoy).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person or object meant to lure something to danger\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A real or fake animal used by hunters to lure game\", \"priority\":2}]}, \"synonyms\":{}}");

	add("decoction", "{\"term\":\"decoction\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027decoccion\u0027 \u0027decoction\u0027 from Latin {{m|la|decoctiō}}, from {{m|la|decoquō||I boil down}}, from \u0027de-\u0027 + \u0027coquō\u0027 (i cook)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An extraction or essence of something, obtained by boiling it down\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Anthony Burgess, \u0027A Dead Man In Deptford\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Poley offered a hot \u0027\u0027decoction\u0027\u0027 of blackberries, saying: Peace\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Jeanette Winterson, \u0027Art \u0026amp; Lies\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Witches and devils no longer threaten you and me. We don’t mind living next door to the harmless lady with her herb garden and \u0027\u0027decoction\u0027\u0027 still, her black cat and red hair\", \"priority\":5}]}, \"synonyms\":{}}");

	add("decode", "{\"term\":\"decode\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A product of decodin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, David Cesarani, [http://books.google.co.uk/books?id\u003d3mamLUa4qnkC\u0026amp;pg\u003dPA14\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u0026amp;f\u003dtrue \u0027Holocaust: Responses to the Persecution and Mass Murder of the Jews\u0027], page 14\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"If and when the remaining Allied intercepts and \u0027\u0027decodes\u0027\u0027 are opened up, we may expect to learn a great deal more about the later stages of the Holocaust\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Richard Breitman, [http://books.google.co.uk/books?id\u003dGnkBYN8ipYcC\u0026amp;pg\u003dPA3\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u0026amp;f\u003dtrue \u0027U.S. Intelligence And The Nazis\u0027], page 3\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The British picked up a \u0027\u0027decode\u0027\u0027 in November 1942 indicating that guards at Auschwitz would need six hundred gas masks\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Ian Pfennigwerth, [http://books.google.co.uk/books?id\u003dZ1UqgA_d1OEC\u0026amp;pg\u003dPA22\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u0026amp;f\u003dtrue \u0027A Man of Intelligence\u0027], page 22\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Decodes\u0027\u0027 stating that Hollandia airfields were becoming overcrowded with IJA aircraft waiting to stage forward to Wewak led to pre-emptive strikes by Allied air forces and the destruction of more than 300 Japanese aircraft on the ground\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Hervie Haufler, [http://books.google.co.uk/books?id\u003dcUFzgt295IoC\u0026amp;pg\u003dPA19\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u0026amp;f\u003dtrue \u0027Codebreakers\u0027 Victory\u0027], page 19\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"He was sure that references to \u0027AK\u0027 in the intercepts stood for Midway, but none of the \u0027\u0027decodes\u0027\u0027 made the identification certain\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Output from a program or device used to interpret communication protocol\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027 Laura Wonnacott, [http://books.google.co.uk/books?id\u003dEFAEAAAAMBAJ\u0026amp;pg\u003dPA3\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u0026amp;f\u003dtrue \u0026quot;Sniffer Pro sees some switches\u0026quot;], \u0027Info World\u0027, page 3\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"This version includes more than 400 \u0027\u0027decodes\u0027\u0027 that cover everything from legacy \u0027\u0027decodes\u0027\u0027 to popular \u0027\u0027decodes\u0027\u0027 and new or updated \u0027\u0027decodes\u0027\u0027 for such protocols as voice over IP H.323, Server Message Block, Border Gateway Protocol Version 4, and Internet Inter-ORB Protocol\", \"priority\":17}]}, \"synonyms\":{}}");

	add("decoder", "{\"term\":\"decoder\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{-er|decode}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who decodes secret message\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A device that decodes a scrambled electronic signal e.g. of a satellite television signal\", \"priority\":2}]}, \"synonyms\":{}}");

	add("decoding", "{\"term\":\"decoding\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An instance of the translation of something into a form more suitable for subsequent processing\", \"priority\":1}]}, \"synonyms\":{}}");

	add("decoherence", "{\"term\":\"decoherence\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"First attested 1902 (OED), in the context of electrical engineering, in the sense of the resetting of a coherer. Decoherence is the verbal noun, standing besides decohesion, derived from decohere (also attested from 1902), the de- negative of cohere (17th century).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process by which a quantum system interacts with its environment in such a way that no interference between states of the system can be observed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The normal condition of sensitiveness in a coherer\", \"priority\":2}]}, \"synonyms\":{}}");

	add("décolletage", "{\"term\":\"décolletage\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027décolletage\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A low neckline on a woman\u0027s dress, especially one that reveals or emphasizes her cleavage\", \"priority\":1}]}, \"synonyms\":{}}");

