	add("deconstruction", "{\"term\":\"deconstruction\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A philosophical theory of textual criticism; a form of critical analysis that emphasizes inquiry into the variable projection of the meaning and message of critical works, the meaning in relation to the reader and the intended audience, and the assumptions implicit in the embodied forms of expression\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The destroying or taking apart of an object; disassembly\", \"priority\":2}]}, \"synonyms\":{}}");

	add("deconstructivism", "{\"term\":\"deconstructivism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|deconstructive|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A development of postmodern architecture that began in the late 1980s, characterized by ideas of fragmentation, an interest in manipulating ideas of a structure\u0027s surface or skin, and non-rectilinear shapes which serve to distort and dislocate\", \"priority\":1}]}, \"synonyms\":{}}");

