	add("deconversion", "{\"term\":\"deconversion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Category:English abstract noun\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The loss of faith in a given religion and return to a previously held religion or non-religion (typically atheism, agnosticism, or rationalism\", \"priority\":2}]}, \"synonyms\":{}}");

