	add("decorum", "{\"term\":\"decorum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|decōrus||proper, decent}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Appropriate social behavior; propriet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027 — w:Pseudonymous Pseudonymous Bosch, \u0027This Isn\u0027t What It Looks Like\u0027, ch\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was sort of a \u0027finishing\u0027 school. You know, to teach proper social \u0027\u0027decorum\u0027\u0027 and so on and so forth\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A convention of social behavior\", \"priority\":4}]}, \"synonyms\":{}}");

	add("decoupage", "{\"term\":\"decoupage\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"French \u0027découpage\u0027 from \u0027découper\u0027 (to cut up)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An art technique in which paper cut outs (either from magazines etc or specially made) are glued onto the surface of an object and sometimes painted or decorate\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An artwork made by this technique\", \"priority\":2}]}, \"synonyms\":{}}");

