	add("decreasement", "{\"term\":\"decreasement\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The action or process of decreasing; a decrease; diminution\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That by which something is decreased or diminished; a decrement\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1662\u0027\u0027 Thomas Salusbury, \u0027Galileo\u0027s Dialogue Concerning the Two Chief World Systems\u0027, Dialogue 2\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"diminishing the velocity with \u0027\u0027decreasements\u0027\u0027 like to the increasements acquired in the descent\", \"priority\":4}]}, \"synonyms\":{}}");

	add("decree", "{\"term\":\"decree\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027decré\u0027 (French \u0027décret\u0027 , from Latin \u0027dēcrētum\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An edict or law\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Bible, Luke ii\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There went out a \u0027\u0027decree\u0027\u0027 from Caesar Augustus that all the world should be taxed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Poor hand, why quiverest thou at this \u0027\u0027decree\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The judicial decision in a litigated cause rendered by a court of equity\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The determination of a cause in a court of admiralty or court of probate\", \"priority\":7}]}, \"synonyms\":{}}");

